import styled from "styled-components";

const ModalEffect = styled.div`
  width: 100%;
  height: 80%;
  background-color: #fff;
  position: fixed;
 top: 50%;
  left: 50%;
  margin-top: -10%;
  margin-left: -50%;
  padding: 30px 20px;
  box-sizing: border-box; 
`;

export default ModalEffect;
